create table personaggi
(
    id           int auto_increment
        primary key,
    nome         varchar(255)  not null,
    cognome      varchar(255)  not null,
    data_nascita date          not null,
    nazionalita  varchar(255)  not null,
    altezza      decimal(3, 2) null,
    biografia    text          not null,
    foto         mediumblob    null
);

INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (1, 'Leonardo', 'DiCaprio', '1974-11-11', 'USA', 1.83, 'Leonardo Wilhelm DiCaprio è un attore, produttore cinematografico e attivista statunitense di origini italiane.

Acclamato dalla critica per il suo lavoro in una vasta gamma di generi cinematografici, nel corso della sua carriera ha collaborato con James Cameron, Baz Luhrmann, Danny Boyle, Clint Eastwood, Christopher Nolan, Steven Spielberg, Ridley Scott, Sam Mendes, Sam Raimi, Woody Allen, Alejandro González Iñárritu, Quentin Tarantino e soprattutto con Martin Scorsese, con cui ha stretto un sodalizio professionale sin dal 2002, considerandolo il suo mentore.

Iniziò la sua carriera apparendo in diversi spot televisivi nei primi anni novanta, per poi ricoprire piccoli ruoli in varie serie tv. Nel 1991 fece il suo debutto nel mondo del cinema con Critters 3, mentre nel 1994 ottenne la sua prima candidatura all\'Oscar per la sua interpretazione in Buon compleanno Mr. Grape. Nel 2016 vinse l\'Oscar come miglior attore per la sua interpretazione di Hugh Glass in Revenant - Redivivo di Iñárritu. Tra i vari riconoscimenti ottenuti figurano anche 6 candidature all\'Oscar, 3 Golden Globe su 12 candidature e un premio BAFTA su 4 candidature.

Nel 2014 fu nominato Messaggero della Pace dal segretario generale delle Nazioni Unite Ban Ki-moon, mentre nel 2016 fu inserito dalla rivista Time al primo posto tra le 100 persone più influenti del pianeta, nella categoria icona.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (2, 'Kate', 'Winslet', '1975-10-05', 'Regno Unito', 1.69, 'Kate Elizabeth Winslet (nata il 5 ottobre 1975) è un\'attrice inglese. Conosciuta per il suo lavoro in film indipendenti, in particolare drammi in costume, così come per i suoi ritratti di donne testarde e complicate, ha ricevuto numerosi riconoscimenti, tra cui un Academy Award, un Grammy Award, due Primetime Emmy Awards, tre British Academy Film Awards, e cinque Golden Globe.

Winslet ha studiato recitazione alla Redroofs Theatre School. La sua prima apparizione sullo schermo, all\'età di 15 anni, è stata nella serie televisiva britannica Dark Season (1991). Ha fatto il suo debutto cinematografico interpretando un\'adolescente assassina in Heavenly Creatures (1994), e ha vinto un BAFTA Award per aver interpretato Marianne Dashwood in Sense and Sensibility (1995). La celebrità globale è seguita subito dopo con il suo ruolo da protagonista nell\'epico romanzo Titanic (1997), che le è valso una nomination all\'Oscar come migliore attrice protagonista. Titanic è stato il film di maggior incasso all\'epoca, dopo di che ha evitato parti in film di successo a favore di film d\'epoca acclamati dalla critica, tra cui Quills (2000) e Iris (2001).

La storia d\'amore di fantascienza Eternal Sunshine of the Spotless Mind (2004), in cui Winslet è stata scelta contro il tipo in un ambiente contemporaneo, si è rivelata un punto di svolta nella sua carriera e ha ottenuto un ulteriore riconoscimento per le sue interpretazioni in Alla ricerca dell\'isola che non c\'è (2004) , Little Children (2006), Revolutionary Road (2008) e The Reader (2008). Per aver interpretato un\'ex guardia del campo nazista in quest\'ultimo, ha vinto il BAFTA Award e l\'Oscar come migliore attrice. L\'interpretazione di Winslet di Joanna Hoffman nel film biografico Steve Jobs (2015) le è valsa un altro BAFTA Award e ha vinto due Primetime Emmy Awards per le sue interpretazioni nella miniserie della HBO Mildred Pierce (2011) e Mare of Easttown (2021).

Per la sua narrazione di un racconto nell\'audiolibro Listen to the Storyteller (1999), Winslet ha vinto un Grammy Award. Ha eseguito la canzone "What If" per la colonna sonora del suo film Christmas Carol: The Movie (2001). Co-fondatrice dell\'ente di beneficenza Golden Hat Foundation, che mira a creare consapevolezza sull\'autismo, ha scritto un libro sull\'argomento, The Golden Hat: Talking Back to Autism (2010). La rivista Time l\'ha nominata una delle 100 persone più influenti al mondo nel 2009 e nel 2021. Nel 2012 è stata nominata Comandante dell\'Ordine dell\'Impero Britannico (CBE). Divorziata dai registi Jim Threapleton e Sam Mendes, Winslet è sposata con l\'uomo d\'affari Edward Abel Smith dal 2012. Ha un figlio da ogni matrimonio.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (3, 'Elijah', 'Wood', '1981-01-28', 'USA', 1.68, 'Elijah Jordan Wood (nato il 28 gennaio 1981) è un attore e produttore americano. È meglio conosciuto per la sua interpretazione di Frodo Baggins nella trilogia del film Il Signore degli Anelli (2001-2003) e Lo Hobbit: Un viaggio inaspettato (2012).

Wood ha fatto il suo debutto cinematografico con una piccola parte in Ritorno al futuro, parte II (1989). Ha continuato a ottenere il riconoscimento come attore bambino con ruoli in Avalon (1990), Paradise (1991), Radio Flyer (1992), Forever Young (1992), Le avventure di Huck Finn (1993) e The Good Son (1993). ). Da adolescente, ha recitato in film come North (1994), The War (1994), Flipper (1996), The Ice Storm (1997), Deep Impact (1998) e The Faculty (1998). Dopo il successo de Il Signore degli Anelli, Wood è apparso in una vasta gamma di film, tra cui Spy Kids 3D: Game Over (2003), Eternal Sunshine of the Spotless Mind (2004), Sin City (2005), Green Street Hooligans (2005), Everything Is Illuminated (2005), Paris, je t\'aime (2006), Bobby (2006), Celeste and Jesse Forever (2012), Maniac (2012), Grand Piano, Cooties, The Last Witch Hunter (2015 ), La fiducia (2016),

I ruoli vocali di Wood includono Mumble in Happy Feet (2006) e il suo sequel (2011), il personaggio del titolo in 9 (2009), Spyro the Dragon nella trilogia di videogiochi Legend of Spyro (2006-2008), Beck in Tron di Disney XD: Uprising (2012-2013) e Wirt nella miniserie di Cartoon Network Over the Garden Wall (2014). Ha anche interpretato Ryan Newman nella serie comica dark di FX Wilfred (2011-2014), per la quale ha ricevuto una nomination al Satellite Award come miglior attore, e Todd Brotzman nella serie della BBC America Dirk Gently\'s Holistic Detective Agency (2016-2017).', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (4, 'Bryan', 'Cranston', '1956-03-07', 'USA', 1.79, 'Bryan Lee Cranston è un attore, regista, produttore cinematografico e doppiatore americano.

Nasce il 7 Marzo 1956 a Los Angeles, suo padre era un attore e sua madre un\'interprete di radiodrammi. Entrambi di origini tedesche.

E\' sposato con l\'attrice Robin Dearden con la quale ha avuto una figlia.

Deve la sua fama al ruolo di Hal, il padre della sit com americana "Malcom" e di Walter White, protagonista della pluripremiata serie televisiva "Breaking Bad", interpretazione che gli è valsa quattro premi Emmy come miglior attore protagonista nel 2008, nel 2009 nel 2010 e nel 2014.

Ha anche avuto un ruolo minore nella sit com "How I met your mother" nel ruolo del capo di Ted Mosby.

E\' conosciuto anche per molte interpretazioni cinematografiche come "Total Recall - Atto di forza", "Argo", "Godzilla" e "L\'ultima parola - La vera storia di Dalton Trumbo".', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (5, 'Millie', 'Bobby Brown', '2004-02-19', 'Regno Unito', 1.63, 'Millie è nata in spagna il 19 Febbario 2004 da genitori inglesi. La sua famiglia si è trasferita a Orlando, in Florida (USA) nel 2011, dove Millie, durante un workshop di recitazione frequentato per passare il tempo, è stata notata da una talent scout, che ha consigliato ai genitori di mettere a frutto ad Hollywood la sua bravura nel recitare.

La famiglia di Millie si è così spostata a Los Angeles, dove Millie ha incontrato diversi agenti, che si sono tutti offerti di rappresentarla. A tre mesi dal trasferimento, le è stato offerto il ruolo di Alice da giovane in "Once Upon a Time", seguito a novembre 2013 dall\'offerta del ruolo di Madison O\'Donnel in "Intruders", della BBC America. Nel 2015 viene scelta per il ruolo di Undici nella serie tv targata Netflix "Stranger Things", mentre nel 2019 fa il suo debutto al cinema come co-protagonista nel film "Godzilla II - King of the Monsters".

Nel 2018 incomincia a collaborare alla realizzazione di una serie di film incentrati su Enola Holmes, giovane detective e sorella minore del celebre Sherlock Holmes. Il primo film, "Enola Holmes", uscito nel 2020 in esclusiva sulla piattaforma Netflix con la regia di Harry Bradbeer.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (6, 'Jennifer', 'Aniston', '1969-02-11', 'USA', 1.64, 'Jennifer Joanna Anastassakis, meglio nota come Jennifer Aniston (Los Angeles, 11 febbraio 1969), è un\'attrice, regista e produttrice cinematografica statunitense.

La Aniston ha ottenuto il riconoscimento in tutto il mondo per aver interpretato Rachel Green nella popolare sitcom televisiva Friends (1994-2004), un ruolo che le è valso un Premio Emmy, un Golden Globe e uno Screen Actors Guild Award. Il personaggio era molto popolare durante la messa in onda della serie, ed è stato riconosciuto come uno dei "100 più grandi personaggi femminili in televisione negli Stati Uniti".

I suoi successi al botteghino includono Una settimana da Dio (2003), Ti odio, ti lascio, ti... (2006), Io & Marley (2008), Mia moglie per finta (2011), Come ammazzare il capo e vivere felici (2011) e Come ti spaccio la famiglia (2013), ognuno dei quali hanno incassato oltre $200 milioni di entrate in tutto il mondo. Le sue interpretazioni più acclamate sono in The Good Girl (2002) e Cake (2014), per il quale ha ricevuto una candidatura per il Golden Globe per la migliore attrice in un film drammatico e agli Screen Actors Guild Awards. È cofondatrice, nel 2008, della società di produzione Echo Films.

Nel 2004, la Aniston è stata classificata "la donna più bella" dal periodico People, ed è stata eletta la "donna più sexy di tutti i tempi" nel 2011. Nel 2012, ha ricevuto una stella sulla Hollywood Walk of Fame, ed è una delle attrici più pagate di Hollywood. Nel 2007, è stata classificata come "11ª donna più ricca nel settore dello spettacolo", con una fortuna stimata di $110 milioni. È stata inserita da molte riviste negli elenchi di donne più belle del mondo.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (7, 'Tom', 'Hanks', '1956-07-09', 'USA', 1.83, 'Thomas Jeffrey Hanks, detto Tom (Concord, 9 luglio 1956), è un attore, regista, sceneggiatore, doppiatore, produttore cinematografico e produttore televisivo statunitense.

La sua carriera ha avuto inizio negli anni ottanta quando, interpretando la serie Henry e Kip (Bosom Buddies), cominciò a esser conosciuto; da allora ha recitato in numerosi film ottenendo un grande successo di critica e di pubblico. Nel corso della sua carriera ha ricevuto cinque candidature agli Oscar, ed è tra i pochi attori nella storia ad aver vinto due Oscar al miglior attore consecutivamente: nel 1994 per Philadelphia e nel 1995 per Forrest Gump. Ha inoltre vinto quattro Golden Globe, due Screen Actors Guild Award, cinque Emmy e un Orso d\'argento al Festival di Berlino.

Tra gli incarichi svolti c\'è stato, a partire dal 2005, quello di vicepresidente dell\'Academy, la società che ogni anno assegna i premi Oscar. Hanks, inoltre, anche se non è più vicepresidente, è tuttora membro del Consiglio di Amministrazione dell\'Academy.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (8, 'Robert', 'Zemeckis', '1951-05-14', 'USA', 1.83, 'Robert Lee Zemeckis (nato il 14 maggio 1952) è un regista, produttore e sceneggiatore americano. Zemeckis è venuto all\'attenzione del pubblico per la prima volta negli anni \'80 come regista della serie di film comici Ritorno al futuro sul viaggio nel tempo, così come del film epico live-action / animazione vincitore di un Oscar Chi ha incastrato Roger Rabbit (1988), anche se nel Negli anni \'90 si è diversificato in piatti più drammatici, incluso Forrest Gump del 1994, per il quale ha vinto un Academy Award come miglior regista.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (9, 'Winston', 'Groom', '1944-03-23', 'USA', 1.71, 'Winston F. Groom, Jr. (nato il 23 marzo 1944) è un romanziere e scrittore di saggistica americano, meglio conosciuto per il suo libro Forrest Gump, che è stato adattato in un film nel 1994.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (10, 'Robin', 'Wright', '1966-04-08', 'USA', 1.68, 'Robin Gayle Wright (nato l\'8 aprile 1966) è un\'attrice americana. È meglio conosciuta per i suoi ruoli come Jenny Curran in Forrest Gump, come Buttercup in The Princess Bride e come Mary Surratt in The Conspirator. È stata anche accreditata come Robin Wright Penn.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (11, 'Eric', 'Roth', '1945-03-22', 'USA', 1.78, 'Eric Roth (nato il 22 marzo 1945) è uno sceneggiatore americano. Ha vinto l\'Oscar per la migliore sceneggiatura adattata per Forrest Gump (1994). Ha anche co-scritto la sceneggiatura di The Insider (1999) di Michael Mann, il film di Steven Spielberg Munich (2005) e il film di David Fincher Il curioso caso di Benjamin Button (2008), tutti nominati agli Oscar.

Roth è nato a New York City, New York, figlio di Miriam "Mimi", insegnante, dirigente di studio e scrittrice radiofonica, e Leon Roth, insegnante universitario e produttore cinematografico. Ha conseguito un Master of Fine Arts (MFA) presso la UCLA Film School e una laurea presso l\'Università della California', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (12, 'Gary', 'Sinise', '1995-03-17', 'USA', 1.75, 'Gary Alan Sinise (nato il 17 marzo 1955) è un attore, regista, umanitario e musicista americano. Tra gli altri premi, ha vinto un Primetime Emmy Award, un Golden Globe, un Tony Award e quattro Screen Actors Guild Awards. Ha anche ricevuto una stella sulla Hollywood Walk of Fame ed è stato nominato per un Academy Award.

Ha anche ricevuto numerosi premi e riconoscimenti per il suo vasto lavoro umanitario e il coinvolgimento con organizzazioni di beneficenza. È un sostenitore di varie organizzazioni di veterani e ha fondato la Lt. Dan Band (dal nome del suo personaggio in Forrest Gump), che suona nelle basi militari di tutto il mondo.

La sua carriera di attore è iniziata sul palcoscenico con la Steppenwolf Theatre Company nel 1983, quando ha diretto e interpretato una produzione di True West di Sam Shepard per la quale ha vinto un Obie Award. In seguito avrebbe ottenuto quattro nomination ai Tony Award, anche per le sue interpretazioni in L\'uva dell\'ira e Qualcuno volò sul nido del cuculo. Ha vinto il Regional Theatre Award del Tony Award insieme alla Steppenwolf Theatre Company.

Ha recitato per la prima volta nell\'adattamento cinematografico del romanzo classico di John Steinbeck Uomini e topi, che ha anche diretto e prodotto. Sinise ha interpretato George Milton al fianco di John Malkovich che interpretava Lennie.

Uno dei suoi ruoli più noti è quello del tenente Dan Taylor in Forrest Gump (1994) per il quale è stato nominato all\'Oscar come miglior attore non protagonista. È apparso anche in altri lungometraggi tra cui Apollo 13 (1995) di Ron Howard, Ransom (1996), Il miglio verde (1999) e Impostor (2002) di Frank Darabont.

Le sue interpretazioni televisive includono Harry S. Truman in Truman (1995), per il quale ha vinto un Golden Globe, e il ruolo principale nel film televisivo George Wallace, per il quale ha ricevuto un Primetime Emmy Award.

Ha avuto un ruolo da protagonista nel ruolo del detective Mac Taylor nella serie drammatica della CBS CSI: NY (2004-2013). Dal 2016 al 2017 ha recitato nel ruolo dell\'agente speciale Jack Garrett in Criminal Minds: Beyond Borders. Nel 2017, ha avuto un ruolo nella serie Netflix 13 Reasons Why.

È stato anche narratore di numerose docuserie e documentari.', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (13, 'Zachary', 'Levi', '1980-09-29', 'USA', 1.91, 'È conosciuto soprattutto per i ruoli di Kipp Steadman nella serie televisiva Perfetti... ma non troppo e Chuck Bartowski nella serie televisiva Chuck. Dal suo nome completo ha fatto decadere il cognome di origine gallese Pugh (che si pronuncia Più), considerandolo difficile da collocare nel mondo dello spettacolo', );
INSERT INTO moviemania.personaggi (id, nome, cognome, data_nascita, nazionalita, altezza, biografia, foto) VALUES (14, 'Ian', 'McKellen', '1939-05-25', 'Regno Unito', 1.80, 'Sir Ian Murray McKellen, CH, CBE (nato il 25 maggio 1939) è un attore inglese. Ha ricevuto sei Laurence Olivier Awards, un Tony Award, un Golden Globe Award, uno Screen Actors Guild Award, un BIF Award, due Saturn Awards, quattro Drama Desk Awards e due Critics\' Choice Awards. Ha anche ricevuto due candidature all\'Oscar, otto candidature cinematografiche e televisive ai BAFTA e cinque candidature agli Emmy. Il lavoro di McKellen abbraccia generi che vanno dal teatro shakespeariano e moderno al fantasy popolare e alla fantascienza. I suoi ruoli cinematografici degni di nota includono Gandalf nelle trilogie de Il Signore degli Anelli e Lo Hobbit e Magneto nei film degli X-Men.', );
